import React from "react";
import styled from "styled-components";
import { useMocks } from "../context/mock-context";
const Menu = props => {
  const { menu } = useMocks();
  return (
    <ul>
      {menu.map(item => (
        <li>{item.item}</li>
      ))}
    </ul>
  );
};
export default Menu;

const MenuDesktop = styled.ul`
  display: flex;
`;
